import{_ as a,c as t,a as h,e as l,r as i,o as s}from"./app.109432a7.js";const f=JSON.parse('{"title":"\uACE0\uB4F1\uD559\uAD50 \uC878\uC5C5\uC2DD","description":"","frontmatter":{"title":"\uACE0\uB4F1\uD559\uAD50 \uC878\uC5C5\uC2DD","createBy":"2023-01-10T00:00:00.000Z"},"headers":[{"level":2,"title":"","slug":"\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}"},{"level":2,"title":"(1) \uAE30\uC0C1","slug":"_1-\uAE30\uC0C1"},{"level":2,"title":"(2) \uD559\uAD50 \uB3C4\uCC29","slug":"_2-\uD559\uAD50-\uB3C4\uCC29"},{"level":2,"title":"(3) \uC878\uC5C5\uC2DD \uC2DC\uC791","slug":"_3-\uC878\uC5C5\uC2DD-\uC2DC\uC791"},{"level":2,"title":"(4) \uC810\uC2EC","slug":"_4-\uC810\uC2EC"},{"level":2,"title":"","slug":"\uC624\uB298-\uD55C\uC77C\uB4E4"},{"level":2,"title":"\uB313\uAE00","slug":"\uB313\uAE00"}],"relativePath":"sdhs/2301/230110.md"}'),d={name:"sdhs/2301/230110.md"};function n(o,e,c,p,b,_){const r=i("Comment");return s(),t("div",null,[e[0]||(e[0]=h('<h2 id="\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}" tabindex="-1"><h2 style="font-size:30px;">\uC624\uB298\uC758 \uC77C\uC9C0 \u{1F3AA}</h2> <a class="header-anchor" href="#\uC624\uB298\uC758-\uC77C\uC9C0-\u{1F3AA}" aria-hidden="true">#</a></h2><p>\uC624\uB298\uC740 \uACE0\uB4F1\uD559\uAD50 \uC878\uC5C5\uC2DD\uC774\uB2E4. 2020\uB144\uB3C4\uBD80\uD130 3\uB144\uB3D9\uC548 \uB2E4\uB154\uB358 \uD559\uAD50\uC600\uB294\uB370 \uBC8C\uC368 \uC878\uC5C5\uC774\uB77C\uB2C8...</p><h2 id="_1-\uAE30\uC0C1" tabindex="-1">(1) \uAE30\uC0C1 <a class="header-anchor" href="#_1-\uAE30\uC0C1" aria-hidden="true">#</a></h2><hr><p>\uC878\uC5C5\uC2DD\uC740 10\uC2DC\uBD80\uD130 \uC2DC\uC791\uD560 \uC608\uC815\uC774\uC9C0\uB9CC \uD559\uC0DD\uB4E4\uC740 9\uC2DC\uAE4C\uC9C0 \uD559\uAD50\uC5D0 \uB3C4\uCC29\uD558\uB77C\uACE0 \uD574\uC11C \uD3C9\uC18C\uCC98\uB7FC \uC544\uCE68 6\uC2DC\uC5D0 \uAE30\uC0C1\uD588\uB2E4. \uB9E8\uB0A0 7\uC2DC\uC5D0 \uC77C\uC5B4\uB098\uB2E4\uAC00 \uC774\uC2DC\uAC04\uC5D0 \uC77C\uC5B4\uB098\uB2C8 \uB354 \uC878\uB838\uB2E4. \uC624\uB298\uC740 \uD559\uAD50\uC5D0 \uAC00\uC9C0\uB9CC \uBCF5\uC7A5\uC740 \uAD50\uBCF5\uC544\uB2C8\uBA74 \uBB34\uB09C\uD55C \uC0AC\uBCF5\uC774\uB77C\uACE0 \uD558\uC600\uAE30\uC5D0 \uB300\uCDA9 \uD6C4\uB450\uD2F0 \uD558\uB098\uC5D0 \uB871\uD328\uB529\uC744 \uAC78\uCE58\uACE0 \uD559\uAD50\uB85C \uCD9C\uBC1C\uD588\uB2E4. \uC774\uC81C \uC774\uB807\uAC8C \uC77C\uCC0D \uD559\uAD50\uB85C \uB4F1\uAD50\uD558\uB294 \uAC83\uB3C4 \uC624\uB298\uC774 \uB9C8\uC9C0\uB9C9\uC774\uB77C\uB2C8 \uC880 \uC2AC\uD508 \uB290\uB08C\uC774 \uB4E4\uC5C8\uB2E4. <br><br> \uC9C0\uD558\uCCA0\uC5D0\uC11C \uB0B4\uB824\uC11C \uD3C9\uC18C\uC5D0 \uD559\uAD50\uC5D0 \uAC19\uC774 \uAC00\uB294 \uC598\uB4E4\uD55C\uD14C \uC804\uD654\uB97C \uD574\uBCF4\uB2C8 \uC544\uC9C1 \uC9D1\uC774\uB77C\uACE0 \uD588\uB2E4. \uB0B4\uAC00 \uC880 \uC77C\uCC0D \uCD9C\uBC1C\uD558\uAE34 \uD588\uC9C0\uB9CC \uC544\uC9C1\uB3C4 \uC9D1\uC774\uB77C\uB2C8 \uB0B4\uAC00 \uADF8\uB807\uAC8C \uBE68\uB9AC \uCD9C\uBC1C\uD588\uC5C8\uB098...?</p><h2 id="_2-\uD559\uAD50-\uB3C4\uCC29" tabindex="-1">(2) \uD559\uAD50 \uB3C4\uCC29 <a class="header-anchor" href="#_2-\uD559\uAD50-\uB3C4\uCC29" aria-hidden="true">#</a></h2><hr><p>\uD559\uAD50\uC5D0 \uB3C4\uCC29\uD588\uB2E4. \uC2DC\uAC04\uC744 \uBCF4\uB2C8 \uC544\uC9C1 8\uC2DC 10\uBD84\uC774\uC5C8\uB2E4(9\uC2DC\uAE4C\uC9C0\uC778\uB370..). \uC624\uBA74\uC11C \uB9C8\uC744\uBC84\uC2A4 \uC548\uC5D0\uC11C\uB3C4 \uC6B0\uB9AC\uD559\uAD50 \uD559\uC0DD \uAC19\uC544 \uBCF4\uC774\uB294 \uC0AC\uB78C\uC740 \uC5C6\uC5C8\uACE0 \uB9E8\uB0A0 \uAF49 \uCC28\uB358 \uBC84\uC2A4\uB3C4 \uB110\uB110\uD588\uAE30\uC5D0 \uC624\uAE30\uC5D0 \uD3B8\uD558\uAE34 \uD588\uB2E4. <br><br> \uD559\uAD50\uC5D0 \uB3C4\uCC29\uD574\uC11C \uAD50\uC2E4\uB85C \uAC00\uBCF4\uB2C8 \uC6B0\uB9AC\uBC18\uC5D0 \uC788\uB358 \uCEF4\uD4E8\uD130\uAC00 \uC804\uBD80 \uC0C8\uCEF4\uD4E8\uD130\uB85C \uBC14\uB00C\uC5B4\uC838 \uC788\uC5C8\uB2E4(\uBCF8\uCCB4\uC5D0 \uBAA8\uB2C8\uD130, \uB9C8\uC6B0\uC2A4, \uD0A4\uBCF4\uB4DC\uAE4C\uC9C0...). \uC774\uBC88\uB144\uB3C4\uC5D0 \uC548\uADF8\uB798\uB3C4 \uC5EC\uB984\uBC29\uD559\uC5D0 \uD559\uAD50 \uACF5\uC0AC\uB97C \uD574\uC11C 1, 2\uD559\uB144\uB4E4\uC774 \uC4F0\uB294 \uAD50\uC2E4\uB3C4 \uD6E8\uC52C \uC88B\uC544\uC84C\uB294\uB370 \uCEF4\uD4E8\uD130\uAE4C\uC9C0 \uBC14\uB00C\uACE0 \uC774\uBC88\uB144\uB3C4 \uC2E0\uC785\uC0DD\uB4E4\uC740 \uC544\uC774\uD328\uB4DC\uAE4C\uC9C0 \uB300\uC5EC\uD574\uC900\uB2E4\uB294\uB370 \uB9E8\uB0A0 \uC878\uC5C5\uB9CC \uD558\uBA74 \uD559\uAD50\uC2DC\uC124\uC774 \uB354 \uC88B\uC544\uC9C0\uB294 \uAC83 \uAC19\uB2E4. <br><br> 9\uC2DC\uAC00 \uC810\uC810 \uAC00\uAE4C\uC6CC\uC9C0\uACE0 \uC6B0\uB9AC\uBC18 \uC598\uB4E4\uC774 \uD558\uB098\uB458 \uB3C4\uCC29\uD588\uB2E4. 9\uC2DC 20\uBD84\uCBE4 \uB418\uB2C8 \uB2F4\uC784\uC324\uC774 \uAD50\uC2E4\uC5D0 \uB4E4\uC5B4\uC624\uACE0 \uC878\uC5C5\uC7A5\uACFC \uC878\uC5C5\uC568\uBC94 \uADF8\uB9AC\uACE0 \uC0C1\uC7A5\uACFC \uBB38\uD654\uC0C1\uD488\uAD8C\uC744 \uC92C\uB2E4(\uB2E4\uB978\uD559\uAD50\uB3C4 \uC774\uB7EC\uB294\uC9C0\uB294 \uBAA8\uB974\uACA0\uB294\uB370 \uC6B0\uB9AC\uD559\uAD50\uB294 \uC0C1\uC7A5 \uAC1C\uC218\uB9CC\uD07C \uBB38\uC0C1\uC744 \uC900\uB2E4). \uC878\uC5C5\uC2DD \uC2DC\uC791\uD558\uAE30 \uC804\uC5D0 \uB9AC\uC5B4\uC124\uC744 \uD55C\uB2E4\uACE0 \uC9D0\uC744 \uB2E4 \uB4E4\uACE0 \uAC15\uB2F9\uC73C\uB85C \uC62C\uB77C\uAC14\uB2E4. <br><br> \uD45C\uCC3D\uC7A5\uC774\uB098 \uAD50\uACFC\uC6B0\uC218\uC0C1 \uAC19\uC740 \uC0C1\uC774 \uC544\uB2CC \uB3D9\uCC3D\uD68C\uC7A5\uC0C1? \uD559\uAD50\uC7A5\uC0C1? \uC774\uB7F0 \uC0C1\uB4E4\uC744 \uBC1B\uC744 \uD559\uC0DD\uB4E4\uC740 \uAC15\uB2F9 \uB9E8 \uC55E\uC904\uC5D0 \uC549\uC558\uACE0 \uB098\uBA38\uC9C0 \uC598\uB4E4\uC740 \uADF8\uB4A4\uB85C \uC790\uC720\uB86D\uAC8C \uC549\uC544\uC11C \uB5A0\uB4E4\uC5C8\uB2E4.</p><h2 id="_3-\uC878\uC5C5\uC2DD-\uC2DC\uC791" tabindex="-1">(3) \uC878\uC5C5\uC2DD \uC2DC\uC791 <a class="header-anchor" href="#_3-\uC878\uC5C5\uC2DD-\uC2DC\uC791" aria-hidden="true">#</a></h2><hr><p>10\uC2DC\uAC00 \uB418\uACE0 \uC878\uC5C5\uC2DD\uC774 \uC2DC\uC791\uD588\uB2E4. \uC560\uAD6D\uAC00 \uC81C\uCC3D, \uAD6D\uBBFC\uC758\uB840, \uD559\uAD50\uC7A5 \uC18C\uAC10\uB4F1\uC744 \uD558\uACE0 \uC0C1 \uC218\uC5EC \uD6C4 \uB2F4\uC784\uC324\uB4E4\uC774 \uC18C\uAC10\uC744 \uD55C\uB9C8\uB514\uC529 \uD55C\uB2E4\uC74C \uB9C8\uBB34\uB9AC \uB418\uC5C8\uB2E4(\uB09C \uAD6D\uD68C\uC758\uC6D0\uC0C1\uC744 \uBC1B\uC558\uB2E4. \uBB38\uC0C1 \uB9CC\uC6D0 \uAC1C\uAFC0). <br><br> \uC878\uC5C5\uC2DD\uC740 \uAC70\uC758 1\uC2DC\uAC04 \uAC00\uB7C9 \uC9C4\uD589\uB418\uACE0 \uAC01\uC790 \uC0AC\uC9C4 \uCC0D\uC744 \uC0AC\uB78C\uB4E4\uC740 \uC0AC\uC9C4\uC744 \uCC0D\uACE0 \uC790\uC720\uB86D\uAC8C \uC9D1\uC744 \uAC14\uB2E4. \uB098\uB3C4 \uBA87\uBA87 \uC598\uB4E4\uC774\uB791 \uC0AC\uC9C4\uC744 \uCC0D\uACE0 \uAE30\uB2A5\uBC18\uC2E4\uC5D0\uC11C \uB0B4 \uBA54\uB2EC, \uC0C1\uC7A5\uC744 \uD729\uC4F8\uC5B4\uC11C \uAC00\uBC29\uC5D0 \uB123\uC5C8\uB2E4. \uBD80\uBAA8\uB2D8\uC774\uB791 \uC0AC\uCD0C\uB204\uB098\uAC00 \uC878\uC5C5\uC2DD\uC5D0 \uC640\uC11C \uAC19\uC774 \uC810\uC2EC\uC744 \uBA39\uACE0 \uB3CC\uC544\uAC08 \uC608\uC815\uC774\uC5C8\uB294\uB370 \uAE30\uB2A5\uBC18 \uC120\uBC30 \uD55C\uBD84\uC774 \uD68C\uC0AC \uD6C4\uBC30\uB791 \uAE30\uB2A5\uBC18 \uD6C4\uBC30\uB4E4 \uC878\uC5C5\uD55C\uB2E4\uACE0 \uC624\uC154\uC11C \uAC00\uC871\uB4E4\uC774\uB791\uC740 \uC800\uB141\uC5D0 \uBC25\uC744 \uBA39\uAE30\uB85C \uD558\uACE0 \uC120\uBC30\uB791 \uCE5C\uAD6C\uB4E4\uC774\uB791 \uC810\uC2EC\uC744 \uBA39\uC73C\uB7EC \uAC14\uB2E4. \uC6D0\uB798 \uC900\uC11C(\uAE30\uB2A5\uBC18 \uB3D9\uAE30)\uB3C4 \uAC19\uC774 \uAC00\uC790\uACE0 \uD588\uB294\uB370 \uACE0\uD5A5\uCE5C\uAD6C\uB4E4\uC774 \uB354 \uC18C\uC911\uD558\uB2E4\uBA74\uC11C \uC6B0\uB9AC\uB97C \uBC84\uB9AC\uACE0 \uB5A0\uB0AC\uB2E4.</p><h2 id="_4-\uC810\uC2EC" tabindex="-1">(4) \uC810\uC2EC <a class="header-anchor" href="#_4-\uC810\uC2EC" aria-hidden="true">#</a></h2><hr><p>\uAC19\uC774 \uC810\uC2EC\uC744 \uBA39\uC73C\uB7EC \uAC14\uB294\uB370 \uC2DC\uAC04\uB3C4 \uC544\uC9C1 \uC624\uC804\uC774\uC5B4\uC11C \uC5F0\uAC00\uAC8C\uB3C4 \uBCC4\uB85C \uC5C6\uACE0 \uBA39\uACE0 \uC2F6\uC740 \uAC83\uB3C4 \uB531\uD788 \uC5C6\uC5B4\uC11C \uACE0\uBBFC\uC744 \uD558\uB2E4\uAC00 \uADF8\uB0E5 \uAD50\uCD0C\uCE58\uD0A8\uC744 \uBA39\uC73C\uB7EC \uAC14\uB2E4. \uC219\uB300\uC785\uAD6C\uC5ED \uADFC\uCC98\uC5D0 \uC788\uB294 \uACF3\uC73C\uB85C \uAC14\uB294\uB370 \uC544\uC9C1 \uC624\uD508\uC2DC\uAC04\uC774 15\uBD84\uC815\uB3C4 \uB0A8\uC544\uC788\uC5C8\uC9C0\uB9CC \uADF8\uB0E5 \uB4E4\uC5EC\uBCF4\uB0B4\uC918\uC11C \uB4E4\uC5B4\uAC00\uC11C \uCE58\uD0A8\uC744 \uBA39\uC5C8\uB2E4. <br><br> \uCE58\uD0A8\uC744 \uBA39\uC73C\uBA74\uC11C \uAC19\uC774 \uB300\uD654\uB97C \uD558\uB294\uB370 \uD68C\uC0AC \uC598\uAE30\uC778\uC9C0 \uC544\uB2CC\uC9C0\uB294 \uC798 \uBAA8\uB974\uACA0\uC9C0\uB9CC \uAC1C\uBC1C \uAD00\uB828\uD574\uC11C \uC608\uAE30\uB97C \uD558\uB294\uB370 \uB09C \uC804\uD600 \uBABB\uC54C\uC544 \uB4E3\uB294 \uC598\uAE30\uB4E4\uC774\uC5C8\uB2E4. \uADF8\uB0E5 \uB9D0\uD558\uB294\uB370 \uB9DE\uC7A5\uAD6C\uB9CC \uCCE4\uB2E4. <br><br> \uCE58\uD0A8\uC740 \uC120\uBC30\uAC00 \uC0AC\uC92C\uACE0 \uC9C0\uD558\uCCA0 \uC5ED\uC5D0\uC11C \uD574\uC0B0\uD588\uB2E4. \uC544\uC9C1 \uD3C9\uC77C \uC624\uC804\uC778\uB370 \uC624\uB294\uAE38\uC5D0 \uC9C0\uD558\uCCA0\uC5D0\uB294 \uC0AC\uB78C\uC774 \uB9CE\uC544\uC11C \uB180\uB790\uB2E4.</p><h2 id="\uC624\uB298-\uD55C\uC77C\uB4E4" tabindex="-1"><h2 style="color:#ee4867;font-size:30px;">\uC624\uB298 \uD55C\uC77C\uB4E4</h2> <a class="header-anchor" href="#\uC624\uB298-\uD55C\uC77C\uB4E4" aria-hidden="true">#</a></h2><hr><ul><li>\uC878\uC5C5\uC2DD \uC9C4\uD589</li></ul><br><br><h2 id="\uB313\uAE00" tabindex="-1">\uB313\uAE00 <a class="header-anchor" href="#\uB313\uAE00" aria-hidden="true">#</a></h2><hr><br>',22)),l(r)])}var m=a(d,[["render",n]]);export{f as __pageData,m as default};
